"id": "-6rsrMCcEsY8",
"colab_type": "code",
"colab": {}
},
"source": [
"# Define loss function and optimizer\n",
"loss_func = tf.keras.losses.BinaryCrossentropy()\n",
"optimizer = tf.keras.optimizers.Adam(learning_rate=0.001)"
],
"execution_count": 0,
"outputs": []
},
{
